import styled from 'styled-components';

const Help = () => {
  return (
    <HelpWrapper>
      <h1>About</h1>
      <p>This is a Gatsby starter blog with TypeScript and styled-components.</p>
    </HelpWrapper>
  );
};

const HelpWrapper = styled.div`
  max-width: 960px;
  margin: 0 auto;
  padding: 0 1rem;
`;

export default Help;
